function Navigation() {
  return (
    <nav>
      <div>
        <img src="horchata.png" alt="" srcset="" height="50px" width="50px" />
      </div>
      <div>
        <h3 class="horchata-tube">HorchataTube</h3>
      </div>
    </nav>
  );
}

export default Navigation;
